import React from 'react';

export default class VideoList extends React.Component {



	render() {
		const { videos } = this.props;
		// console.log(videos)

		return (
			<div className='video-list__wrapper'>
				{
					videoList.map((video) => (
						<h2>{video.snippet.title}</h2>
					))
				}
			</div>
		)
	}
}
